import React from 'react';
import styled from "styled-components";

const StyledGallery = styled.div`
  background: #F1F8F4;
  padding: 10rem 0;
  display: flex;
  align-items: center;
  justify-content: space-between;
`

const GalleryItem = styled.div`
  position: relative;
`

const GalleryItemImg = styled.img`
  position: absolute;
`

function Gallery() {
  return (
    <StyledGallery>
      <GalleryItem>
        <GalleryItemImg src="./img/gallery/image-1.jpg" alt="" />
      </GalleryItem>
    </StyledGallery>
  );
}

export default Gallery;
